$.fn.tabs = function () {
  var n = $(this);
  n.on("click", "li", function () {
    if (!$(this).hasClass("active")) {
      debugger;
      n.find("li").removeClass("active");
      $(this).addClass("active");
      var t = $(this).data("id");
      $("#" + t)
        .siblings()
        .hide();
      $("#" + t).show();
    }
  });
};
